@-moz-document domain("youtube.com") {
  /* Set the background image to a random URL */
  body {
    background-image: url('https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/ffa4ad00-3340-4946-bb16-e9603d023778/dcr9l12-980872e3-3622-4976-ab25-c62638c6b91f.gif?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..PGcCWJBZrBV1N_XwER-BopMU55Ta3NrQhXf-nN6TEd4');
    background-repeat: no-repeat;
    background-size: cover;
  }

  /* Make the header more compact */
  #masthead-container {
    height: 56px;
    padding-top: 4px;
  }

  /* Reduce the size of the logo */
  #logo-icon-container {
    width: 70px;
  }

  /* Reduce the height of the search bar */
  #search-container {
    height: 32px;
  }

  /* Make video thumbnails smaller */
  .ytd-compact-video-renderer {
    width: 250px;
  }

  /* Reduce spacing between video thumbnails */
  #contents {
    display: flex;
    flex-wrap: wrap;
    margin: -10px;
  }

  /* Remove video borders and increase video title size */
  .ytd-thumbnail {
    border: none;
  }

  #video-title {
    font-size: 16px;
  }
}
